	 Se for indicado 0, então considera todos.%%NL
- 'Inativos, ' = Incluir Funcionários Inativos. Pode ter os valores 0 ou 1, tal que
	0 - Não incluir Funcionários Inativos
	1 = Incluir Funcionários Inativos).%%NL
- 'Abonos' = Código dos Abonos a Incluir (ex: "A001,A002").%%NL
- 'TipoRecibo' = Tipo de recibo a Incluir. Pode ter os valores 1,2, ...,10, tal que:
	0 - Todos;
	1 - Recibo Normal;
	2 - Recibo Férias;
	3 - Recibo Natal;
	4 - R [rest of string was truncated]";.

