Para documentos certificados (de Vendas, Compras, Liquidações, Oficinas e APV), se não existirem movimentos o numerador deve começar em zero:
     1. Verificar se o tipo de documento é certificado;
     2. Verificar se o exercício foi inicializado:
        a) Exercicio inicializado: filtrar por exercicio;
        b) Exercicio não inicializado: não filtrar por exercicio;
     3. Se não existirem movimentos, apresentar mensagem e não permitir alterar o numerador (colocar a zero).
